import React from "react";
import Sidebar from "../../components/Sidebar/Sidebar";
import Box from "@material-ui/core/Box";
import Grid from "@material-ui/core/Grid";
import Container from "@material-ui/core/Container";
import { makeStyles } from "@material-ui/core/styles";
import Typography from "@material-ui/core/Typography";
import TopNavbar from "../../components/Appbar/topNavbar";

const sidebar = {
  articles: [
    { title: "March 2020", url: "#" },
    { title: "February 2020", url: "#" },
    { title: "January 2020", url: "#" },
    { title: "November 1999", url: "#" },
    { title: "October 1999", url: "#" },
    { title: "September 1999", url: "#" },
    { title: "August 1999", url: "#" },
    { title: "July 1999", url: "#" },
    { title: "June 1999", url: "#" },
    { title: "May 1999", url: "#" },
    { title: "April 1999", url: "#" },
  ],
};

const useStyles = makeStyles((theme) => ({
  hero: {
    backgroundImage: `linear-gradient(rgba(0,0,0,0.5), rgba(0,0,0,0.5)), url('https://images.unsplash.com/photo-1584362917165-526a968579e8?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MzR8fGhlYWx0aCUyMGNhcmV8ZW58MHx8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60')`,
    height: "500px",
    backgroundPosition: "center",
    backgroundRepeat: "no-repeat",
    backgroundSize: "cover",
    position: "relative",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    color: "#fff",
    fontSize: "4rem",
  },
}));

const Article = () => {
  const classes = useStyles();

  return (
    <div>
      {/* 
                * Todo List
                Top Navbar
                Hero Image
                Article Title
                Date and Time
                Details
                bottom Tabbar
            */}
      <TopNavbar />
      <Box className={classes.hero}>
        <Box>Health is everything</Box>
      </Box>
      <Container>
        <Grid container>
          <Grid item xs={12} sm={8}>
            <Typography> Title </Typography>
            <Typography> Date </Typography>
            <Typography> Description </Typography>
          </Grid>
          <Grid item xs={12} sm={4}>
            <Sidebar articles={sidebar.articles} />
          </Grid>
        </Grid>
      </Container>
    </div>
  );
};

export default Article;
